"""# 5. Modeling

## 5.1 Model Evaluation
"""

#Top-N accuracy metrics consts
EVAL_RANDOM_SAMPLE_NON_INTERACTED_ITEMS = 100

class ModelEvaluator:
  """
    class model evaluator has 4 function, each function is :
        1. get_not_interacted_items_sample,

        2. _verify_hit_top_n,

        3. evaluate_model_for_user,

        4. evaluate_model
    Aim :
        1. Create Easier Object for Evaluate Model
  """
  def get_not_interacted_items_sample(self, person_id, sample_size, seed=42):
      # define variable of interacted items based on params
      interacted_items = get_items_interacted(person_id, interactions_full_indexed_df)
      # set all content ID in article dataset
      all_items = set(articles_df['contentId'])
      # total population - selected interacted items
      non_interacted_items = all_items - interacted_items
      # define random seed
      random.seed(seed)
      # generate sample of non interacted items based on sample size
      non_interacted_items_sample = random.sample(non_interacted_items, sample_size)
      return set(non_interacted_items_sample)

  def _verify_hit_top_n(self, item_id, recommended_items, topn):   
          # iterate recommended items if equal with item id     
          try:
              index = next(i for i, c in enumerate(recommended_items) if c == item_id)
          # if keyError or ValueError return index is -1
          except:
              index = -1
          # define hit variable
          hit = int(index in range(0, topn))
          return hit, index

  def evaluate_model_for_user(self, model, person_id):
      # get the items in test set
      interacted_values_testset = interactions_test_indexed_df.loc[person_id]
      if type(interacted_values_testset['contentId']) == pd.Series:
          person_interacted_items_testset = set(interacted_values_testset['contentId'])
      else:
          person_interacted_items_testset = set([int(interacted_values_testset['contentId'])])  
      interacted_items_count_testset = len(person_interacted_items_testset) 

      # get a ranked recommendation list from a model for a given user
      person_recs_df = model.recommend_items(person_id, 
                                              items_to_ignore=get_items_interacted(person_id, 
                                                                                  interactions_train_indexed_df), 
                                              topn=10000000000)

      hits_at_5_count = 0
      hits_at_10_count = 0
      # iterate each item the user has interacted in test set
      for item_id in person_interacted_items_testset:
          # get a random sample (100) items the user has not interacted 
          # (to represent items that are assumed to be no relevant to the user)
          non_interacted_items_sample = self.get_not_interacted_items_sample(person_id, 
                                                                        sample_size=EVAL_RANDOM_SAMPLE_NON_INTERACTED_ITEMS, 
                                                                        seed=item_id%(2**32))

          # combining the current interacted item with the 100 random items
          items_to_filter_recs = non_interacted_items_sample.union(set([item_id]))

          # filtering only recommendations that are either the interacted item or from a random sample of 100 non-interacted items
          valid_recs_df = person_recs_df[person_recs_df['contentId'].isin(items_to_filter_recs)]                    
          valid_recs = valid_recs_df['contentId'].values
          # verifying if the current interacted item is among the Top-N recommended items
          hit_at_5, index_at_5 = self._verify_hit_top_n(item_id, valid_recs, 5)
          hits_at_5_count += hit_at_5
          hit_at_10, index_at_10 = self._verify_hit_top_n(item_id, valid_recs, 10)
          hits_at_10_count += hit_at_10

      # recall is the rate of the interacted items that are ranked among the Top-N recommended items, 
      # when mixed with a set of non-relevant items
      recall_at_5 = hits_at_5_count / float(interacted_items_count_testset)
      recall_at_10 = hits_at_10_count / float(interacted_items_count_testset)

      person_metrics = {'hits@5_count':hits_at_5_count, 
                        'hits@10_count':hits_at_10_count, 
                        'interacted_count': interacted_items_count_testset,
                        'recall@5': recall_at_5,
                        'recall@10': recall_at_10}
      return person_metrics

  def evaluate_model(self, model):
      people_metrics = []
      for idx, person_id in enumerate(list(interactions_test_indexed_df.index.unique().values)):
          person_metrics = self.evaluate_model_for_user(model, person_id)  
          person_metrics['_person_id'] = person_id
          people_metrics.append(person_metrics)
      print('%d users processed' % idx)

      detailed_results_df = pd.DataFrame(people_metrics) \
                          .sort_values('interacted_count', ascending=False)
      
      global_recall_at_5 = detailed_results_df['hits@5_count'].sum() / float(detailed_results_df['interacted_count'].sum())
      global_recall_at_10 = detailed_results_df['hits@10_count'].sum() / float(detailed_results_df['interacted_count'].sum())
      
      global_metrics = {'modelName': model.get_model_name(),
                        'recall@5': global_recall_at_5,
                        'recall@10': global_recall_at_10}    
      return global_metrics, detailed_results_df
    
