"""## 5.2 Content Based Filtering

Metode ini memanfaatkan deskripsi atau atribut dari item yang telah berinteraksi dengan pengguna untuk merekomendasikan item serupa. Itu hanya bergantung pada pilihan pengguna sebelumnya, membuat metode ini kuat untuk menghindari masalah cold-start. Untuk item tekstual, seperti artikel, berita, dan buku, mudah menggunakan teks mentah untuk membuat profil item dan profil pengguna.
  
  Di sini penulis menggunakan teknik yang sangat populer dalam pencarian informasi (mesin pencari) bernama TF-IDF. Teknik ini mengubah teks tidak terstruktur menjadi struktur vektor, di mana setiap kata diwakili oleh posisi dalam vektor, dan nilainya mengukur seberapa relevan kata tertentu untuk sebuah artikel. Karena semua item akan direpresentasikan dalam Model Ruang Vektor yang sama, ini untuk menghitung kesamaan antar artikel.
"""

# download stopwords
import nltk
nltk.download("stopwords")

# ignoring stopwords (words with no semantics) from English and Portuguese (as we have a corpus with mixed languages)
stopwords_list = stopwords.words('english') + stopwords.words('portuguese')

# trains a model whose vectors size is 5000, composed by the main unigrams and bigrams found in the corpus, ignoring stopwords
vectorizer = TfidfVectorizer(analyzer='word',
                     ngram_range=(1, 2),
                     min_df=0.003,
                     max_df=0.5,
                     max_features=5000,
                     stop_words=stopwords_list)
# convert pd.Series into list
item_ids = articles_df['contentId'].tolist()
# apply fit & transform tf-idf to title & text dataset
tfidf_matrix = vectorizer.fit_transform(articles_df['title'] + "" + articles_df['text'])
# get feature name after applied tfidf matrix
tfidf_feature_names = vectorizer.get_feature_names()

# sparse matrix format
tfidf_matrix

# define helper function in content based modeling
def get_item_profile(item_id):
    idx = item_ids.index(item_id)
    item_profile = tfidf_matrix[idx:idx+1]
    return item_profile

def get_item_profiles(ids):
    item_profiles_list = [get_item_profile(x) for x in ids]
    item_profiles = scipy.sparse.vstack(item_profiles_list)
    return item_profiles

def build_users_profile(person_id, interactions_indexed_df):
    interactions_person_df = interactions_indexed_df.loc[person_id]
    user_item_profiles = get_item_profiles(interactions_person_df['contentId'])
    
    user_item_strengths = np.array(interactions_person_df['eventStrength']).reshape(-1,1)
    # weighted average of item profiles by the interactions strength
    user_item_strengths_weighted_avg = np.sum(user_item_profiles.multiply(user_item_strengths), axis=0) / np.sum(user_item_strengths)
    user_profile_norm = sklearn.preprocessing.normalize(user_item_strengths_weighted_avg)
    return user_profile_norm

def build_users_profiles(): 
    interactions_indexed_df = interactions_train_df[interactions_train_df['contentId'] \
                                                   .isin(articles_df['contentId'])].set_index('personId')
    user_profiles = {}
    for person_id in interactions_indexed_df.index.unique():
        user_profiles[person_id] = build_users_profile(person_id, interactions_indexed_df)
    return user_profiles

# inherit function to variable
user_profiles = build_users_profiles()

# note, author index here is from original creator 
author = -1479311724257856983
# get author profile
myprofile = user_profiles[author]

# generate dataframe
pd.DataFrame(sorted(zip(tfidf_feature_names, 
                        user_profiles[author].flatten().tolist()), key=lambda x: -x[1])[:20],
             columns=['token', 'relevance'])

"""Author yang menambang dataset merupakan salah satu karyawan dari perusahaan tersebut, serta beliau memiliki interaksi yang aktif dalam judul Ai dan sebagainya sehingga token yang cocok dengan beliau adalah beragam kata yang berhubungan dengan kecerdasan buatan."""

class ContentBasedRecommend:
    
    MODEL_NAME = 'Content-Based'
    
    def __init__(self, items_df=None):
        self.item_ids = item_ids
        self.items_df = items_df
        
    def get_model_name(self):
        return self.MODEL_NAME
        
    def _get_similar_items_to_user_profile(self, person_id, topn=1000):
        # computes the cosine similarity between the user profile and all item profiles
        cosine_similarities = cosine_similarity(user_profiles[person_id], tfidf_matrix)
        # gets the top similar items
        similar_indices = cosine_similarities.argsort().flatten()[-topn:]
        # sort the similar items by similarity
        similar_items = sorted([(item_ids[i], cosine_similarities[0,i]) for i in similar_indices], key=lambda x: -x[1])
        return similar_items
        
    def recommend_items(self, user_id, items_to_ignore=[], topn=10, verbose=False):
        similar_items = self._get_similar_items_to_user_profile(user_id)
        # ignores items the user has already interacted
        similar_items_filtered = list(filter(lambda x: x[0] not in items_to_ignore, similar_items))
        
        recommendations_df = pd.DataFrame(similar_items_filtered, columns=['contentId', 'recStrength']) \
                                    .head(topn)

        if verbose:
            if self.items_df is None:
                raise Exception('"items_df" is required in verbose mode')

            recommendations_df = recommendations_df.merge(self.items_df, how = 'left', 
                                                          left_on = 'contentId', 
                                                          right_on = 'contentId')[['recStrength', 
                                                                                   'contentId', 
                                                                                   'title', 
                                                                                   'url', 
                                                                                   'lang']]


        return recommendations_df

# inherit class above to variable below 
content_based_recommender_model = ContentBasedRecommend(articles_df)

# evaluate model
