"""## 5.3 Collaborative Filtering

pada metode collaborative filtering, penulis menggunakan metode models based. Pendekatan ini, model dikembangkan menggunakan algoritma pembelajaran mesin yang berbeda untuk merekomendasikan item kepada pengguna. Ada banyak model algoritma CF berbasis, seperti jaringan saraf, jaringan bayesian, model clustering, model faktor laten seperti Singular Value Decomposition (SVD), dan analisis semantik laten probabilistik.

Keputusan penting adalah jumlah faktor untuk memfaktorkan matriks item-pengguna. Semakin tinggi jumlah faktor, semakin tepat faktorisasi dalam rekonstruksi matriks asli. Oleh karena itu, jika model dibiarkan mengingat terlalu banyak detail dari matriks asli, model tersebut mungkin tidak dapat digeneralisasi dengan baik untuk data yang tidak dilatihnya. Mengurangi jumlah faktor meningkatkan generalisasi model.
"""

# define a sparse pivot table with users in rows and items in columns
users_items_pivot_matrix_df = interactions_train_df.pivot(index='personId', 
                                                          columns='contentId', 
                                                          values='eventStrength').fillna(0)
                                                          
# show sample data 
users_items_pivot_matrix_df.sample(5)

# convert dataframe become matrix
users_items_pivot_matrix = users_items_pivot_matrix_df.values
# get user id
users_ids = list(users_items_pivot_matrix_df.index)

# apply matrix factorization
users_items_pivot_sparse_matrix = csr_matrix(users_items_pivot_matrix)

# the number of factors to factor the user-item matrix.
NUMBER_OF_FACTORS_MF = 15
# performs matrix factorization of the original user item matrix
# U, sigma, Vt = svds(users_items_pivot_matrix, k = NUMBER_OF_FACTORS_MF)
U, sigma, Vt = svds(users_items_pivot_sparse_matrix, k = NUMBER_OF_FACTORS_MF)
# extract diagonal
sigma = np.diag(sigma)

"""Setelah faktorisasi, penulis mencoba untuk merekonstruksi matriks asli dengan mengalikan faktor-faktornya. Matriks yang dihasilkan tidak jarang lagi. Itu menghasilkan prediksi untuk item yang belum berinteraksi dengan pengguna, yang akan penulis manfaatkan untuk rekomendasi."""

# applied matrix extraction to get all user ratings
all_user_predicted_ratings = np.dot(np.dot(U, sigma), Vt)

# apply normalisation min max
all_user_predicted_ratings_norm = (all_user_predicted_ratings - all_user_predicted_ratings.min()) / (all_user_predicted_ratings.max() - all_user_predicted_ratings.min())

# converting the reconstructed matrix back to a Pandas dataframe
cf_preds_df = pd.DataFrame(all_user_predicted_ratings_norm, columns = users_items_pivot_matrix_df.columns, index=users_ids).transpose()
cf_preds_df.sample(3)

class CFRecommender:
    
    MODEL_NAME = 'Collaborative Filtering'
    
    def __init__(self, cf_predictions_df, items_df=None):
        self.cf_predictions_df = cf_predictions_df
        self.items_df = items_df
        
    def get_model_name(self):
        return self.MODEL_NAME
        
    def recommend_items(self, user_id, items_to_ignore=[], topn=10, verbose=False):
        # Get and sort the user's predictions
        sorted_user_predictions = self.cf_predictions_df[user_id].sort_values(ascending=False) \
                                    .reset_index().rename(columns={user_id: 'recStrength'})

        # Recommend the highest predicted rating movies that the user hasn't seen yet.
        recommendations_df = sorted_user_predictions[~sorted_user_predictions['contentId'].isin(items_to_ignore)] \
                               .sort_values('recStrength', ascending = False) \
                               .head(topn)

        if verbose:
            if self.items_df is None:
                raise Exception('"items_df" is required in verbose mode')

            recommendations_df = recommendations_df.merge(self.items_df, how = 'left', 
                                                          left_on = 'contentId', 
                                                          right_on = 'contentId')[['recStrength', 'contentId', 'title', 'url', 'lang']]


        return recommendations_df
  
# inherit class above to variable below
cf_recommender_model = CFRecommender(cf_preds_df, articles_df)

# evaluate model
print('Evaluating Collaborative Filtering (SVD Matrix Factorization) model...')
cf_global_metrics, cf_detailed_results_df = model_evaluator.evaluate_model(cf_recommender_model)
print('\nGlobal metrics:\n%s' % cf_global_metrics)

"""Mengevaluasi model Collaborative Filtering (faktorisasi matriks SVD), kami mengamati bahwa kami mendapatkan nilai Recall ( 5 teratas ) (33%) dan Recall ( 10 teratas ) (46%), jauh lebih tinggi daripada model content based"""

